llection of stories have been sitting on my shelves for a few months now...I’ve been dying to read it, and this was the push I needed to do so! 🤗💖

It also works for number 44 of the #yearlymangaread_2020 “a collection of one-shots” which I took to mean a collection of short stories 😅🙈 (idk sorry if I am mistaken) and number 7 “morbid/bloody manga” 🩸🙈🤣 and really got me in the mood for the coming Spooky Season! ☠️👻

So, this collection of short one-shot stories range from mildly alarming to full on disgusting. Don’t be fooled by the interesting abstract yet somewhat pretty cover! This book is not for the faint of heart! 🥺🤢 I was constantly disgusted and physically cringing over the subject matter of these stories, but that’s not to say I wasn’t also intrigued and riveted at the same time! I read them all in one go. So, I’d say I found a sick sort of enjoyment from them! 😝😅🤣

Each story was incredibly unique and like nothing I’ve ever read before, although definitely gave me some Junji Ito vibes, and I noticed one of the more prominent core themes of a few of these stories were obsessions or obsessive ideas/desires going to far. Like I said, I was enthralled by the stories, but likewise disgusted at the same time. It’s a very interesting read, but I’d only recommend to people who like the really weird, out there concepts, and aren’t squeamish about bloody/gorey/grotesque imagery. 😅⚠️👍

